import React from "react";
import { useNavigate } from "react-router-dom";

const HomePage = () => {
  const navigate = useNavigate();

  return (
    <div
      className="flex flex-col items-center justify-center h-screen bg-cover bg-center"
      style={{
        backgroundImage:
          "url('https://mp.moonpreneur.com/blog/wp-content/uploads/2023/12/best-productivity-tools-for-children.webp')",
      }}
    >
      <div className="bg-white bg-opacity-70 p-6 rounded-lg shadow-lg text-center">
        <h1 className="text-4xl font-bold mb-4">Welcome to Study Tracker</h1>
        <p className="text-lg mb-6">Track and improve student productivity with AI</p>
        <div className="flex space-x-4">
          <button
            onClick={() => navigate("/register")}
            className="px-6 py-2 bg-green-500 text-white rounded-lg"
          >
            Register
          </button>
          <button
            onClick={() => navigate("/login")}
            className="px-6 py-2 bg-blue-500 text-white rounded-lg"
          >
            Login
          </button>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
